    "narrative-report-valentine-national-wildlife-refuge-period-may-1-august-31-1946",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Valentine NWR
    outlines Refuge accomplishments from May through August of 1946. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    raptors, reptiles, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    Resource management is outlined; topics include grazing and haying. The public relations
    section of the report describes Refuge visitors. N-R forms are attached.",nt"license_title":
